import React, { useState, useEffect, useRef } from 'react';
import { Link, useLocation } from 'react-router-dom';
import { useTranslation } from 'react-i18next';
import './Header.css';

const Header = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isLanguageMenuOpen, setIsLanguageMenuOpen] = useState(false);
  const location = useLocation();
  const languageMenuRef = useRef(null);
  const { t, i18n } = useTranslation();

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  const closeMenu = () => {
    setIsMenuOpen(false);
  };

  const toggleLanguageMenu = () => {
    setIsLanguageMenuOpen(!isLanguageMenuOpen);
  };

  const selectLanguage = (lang) => {
    i18n.changeLanguage(lang.toLowerCase());
    setIsLanguageMenuOpen(false);
  };

  useEffect(() => {
    const handleClickOutside = (event) => {
      if (languageMenuRef.current && !languageMenuRef.current.contains(event.target)) {
        setIsLanguageMenuOpen(false);
      }
    };

    document.addEventListener('mousedown', handleClickOutside);
    return () => {
      document.removeEventListener('mousedown', handleClickOutside);
    };
  }, []);

  return (
    <header className="header">
      <div className="header-container">
        <Link to="/" className="logo-section" onClick={closeMenu}>
          <img 
            src="/TGBC.jpg" 
            alt="TUNISIAGBC Logo" 
            className="logo-image"
          />
        </Link>

        <nav className={`nav ${isMenuOpen ? 'nav-open' : ''}`}>
          <ul className="nav-list">
            <li className="nav-item">
              <Link 
                to="/about" 
                className={`nav-link ${location.pathname === '/about' ? 'active' : ''}`}
                onClick={closeMenu}
              >
                {t('header.tgbc')}
              </Link>
            </li>
            <li className="nav-item">
              <Link 
                to="/members" 
                className={`nav-link ${location.pathname === '/members' ? 'active' : ''}`}
                onClick={closeMenu}
              >
                {t('header.membership')}
              </Link>
            </li>
            <li className="nav-item">
              <Link 
                to="/programs" 
                className={`nav-link ${location.pathname === '/programs' ? 'active' : ''}`}
                onClick={closeMenu}
              >
                {t('header.programs')}
              </Link>
            </li>
            <li className="nav-item">
              <Link 
                to="/events" 
                className={`nav-link ${location.pathname === '/events' ? 'active' : ''}`}
                onClick={closeMenu}
              >
                {t('header.agenda')}
              </Link>
            </li>
            <li className="nav-item">
              <Link 
                to="/resources" 
                className={`nav-link ${location.pathname === '/resources' ? 'active' : ''}`}
                onClick={closeMenu}
              >
                {t('header.resources')}
              </Link>
            </li>
          </ul>

          <div className="header-actions">
            <Link to="/contact" className="btn btn-primary" onClick={closeMenu}>
              Devenir membre
            </Link>
            <div className="language-switcher" ref={languageMenuRef}>
              <button 
                className="globe-btn"
                onClick={toggleLanguageMenu}
                title="Changer la langue"
              >
                üåç
              </button>
              {isLanguageMenuOpen && (
                <div className="language-dropdown">
                  <button 
                    className={`lang-option fr ${currentLanguage === 'FR' ? 'active' : ''}`}
                    onClick={() => selectLanguage('FR')}
                  >
                    üá´üá∑ FR
                  </button>
                  <button 
                    className={`lang-option en ${currentLanguage === 'EN' ? 'active' : ''}`}
                    onClick={() => selectLanguage('EN')}
                  >
                    üá¨üáß EN
                  </button>
                </div>
              )}
            </div>
          </div>
        </nav>

        <button 
          className={`menu-toggle ${isMenuOpen ? 'menu-open' : ''}`}
          onClick={toggleMenu}
          aria-label="Toggle menu"
        >
          <span></span>
          <span></span>
          <span></span>
        </button>
      </div>
    </header>
  );
};

export default Header;
